import './App.css';
import {Helmet} from 'react-helmet';

function App() {
	return (
	<div className="App">
		<Helmet>
			<title> Stoepplantjes </title>
		</Helmet>

		<h1> Stoepplantjes </h1>

	</div>
	);
}

export default App;
